import React from "react";
import { Link } from 'react-router-dom'
import {
  Card,
  Box,
  Image,
  Stack,
  Heading,
  Flex,
  Container,
  Columns,
  Text,
  Paragraph,
  Badge,
} from "bumbag";

import { Moon, Sun, MoreHorizontal } from "react-feather";

const NavBar = () => (
  <Container paddingY="2rem">
    <Columns>
      {/* <Flex alignItems="center" justifyContent="space-between"> */}
        <Columns.Column spreadMobile={6} spread={4}>
          <Heading use="h4">DAVI</Heading>
        </Columns.Column>

        <Columns.Column spreadMobile={6} spread={4}>
          <Moon color="#5863D8"></Moon>
        </Columns.Column>

        <Columns.Column spreadMobile={6} spread={4}>
          <MoreHorizontal />
        </Columns.Column>
      {/* </Flex> */}
    </Columns>
  </Container>
);

export default NavBar;
